import { BrowserRouter, Navigate, Route, Routes} from'react-router-dom'
import './App.css';
import NavBar from './components/NavBar';

function App() {
  return (
    <div>
      <BrowserRouter>
      <NavBar />
      <Routes>
        <Route element={<Navigate to='/homepage'/>} path='/'/>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
